  `type1` int(11) unsigned DEFAULT NULL,
  `type2` int(11) unsigned DEFAULT NULL,
  `ability1` int(11) unsigned DEFAULT NULL,
  `ability2` int(11) unsigned DEFAULT NULL,
  `ability3` int(11) unsigned DEFAULT NULL,
  PRIMARY KEY (`pokedexNumber`),
  KEY `type1_idx` (`type1`),
  KEY `type2_pokemon_idx` (`type2`),
  KEY `ability1_pokemon_idx` (`ability1`),
