  CONSTRAINT `ability1_pokemon` FOREIGN KEY (`ability1`) REFERENCES `Ability` (`abilityId`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `ability2_pokemon` FOREIGN KEY (`ability2`) REFERENCES `Ability` (`abilityId`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `ability3_pokemon` FOREIGN KEY (`ability3`) REFERENCES `Ability` (`abilityId`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `type1_pokemon` FOREIGN KEY (`type1`) REFERENCES `Type` (`typeId`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `type2_pokemon` FOREIGN KEY (`type2`) REFERENCES `Type` (`typeId`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
